import React from "react";
import NavBar from "./navBar"
import "../../stylesheets/contact.css";

function Contact() {

  return (  
    <div className="mainContainer">
        <NavBar />

        <div className="innerContainer">
            <p className="contactText">Have questions? Concerns? Features you hope to have?</p>
            <p className="contactText">Reach out to us at: <p className="black">householdhomies@umich.edu</p></p>
        </div>
    </div>
  );
}

export default Contact;
